    "import React from \"react\";\nimport PropTypes from \"prop-types\";\nimport { FontAwesomeIcon } from \"@fortawesome/react-fontawesome\";\n\nclass QuoteBox extends React.Component {\n  render() {\n    let text;\n    let author;\n    let tweetUrl;\n    let style = this.props.visable ? {opacity: 1} : {opacity: 0};\n    if (this.props.quote) {\n      text = this.props.quote.text;\n      if (this.props.quote.author) {\n        author = `- ${this.props.quote.author}`;\n      } else {\n        author = \"- Anon\";\n      }\n      tweetUrl = encodeURI(`https://twitter.com/intent/tweet?text=${text} -${author}`);\n    } else {\n      text = \"loading...\";\n      author = \"\";\n      tweetUrl = \"https://twitter.com/intent/tweet\";\n    }\n    return (\n      <div id=\"quote-box\" style={style}>\n        <FontAwesomeIcon icon=\"quote-left\" size=\"2x\" className=\"quotes\"/>\n        <div id=\"text\"><p>{text}</p></div>\n        <FontAwesomeIcon icon=\"quote-right\" size=\"2x\" className=\"quotes quotes--right\"/>\n        <div id=\"author\"><p>{author}</p></div>\n        <a id=\"tweet-quote\" className=\"btn\" href={tweetUrl} target=\"_blank\" rel=\"noopener noreferrer\"><FontAwesomeIcon icon={[\"fab\", \"twitter\"]} /> Tweet</a>\n        <button id=\"new-quote\" className=\"btn\" onClick={this.props.handleNewQuote}>New Quote</button>\n      </div>\n    );\n  }\n}\n\nQuoteBox.propTypes = {\n  handleNewQuote: PropTypes.func.isRequired,\n  quote: PropTypes.object,\n  visable: PropTypes.bool\n};\n\nexport default QuoteBox;\n",
    "import React from \"react\";\nimport ReactDOM from \"react-dom\";\nimport { library } from \"@fortawesome/fontawesome-svg-core\";\nimport { faQuoteLeft } from '@fortawesome/free-solid-svg-icons/faQuoteLeft';\nimport { faQuoteRight } from '@fortawesome/free-solid-svg-icons/faQuoteRight';\nimport { faTwitter } from \"@fortawesome/free-brands-svg-icons/faTwitter\";\nimport QuoteBox from \"./QuoteBox\";\n\nlibrary.add(faTwitter, faQuoteLeft, faQuoteRight);\n\nclass App extends React.Component {\n  constructor(props) {\n    super(props);\n\n    this.state = {\n      quote: null,\n      visable: true,\n      colorIndex: 0\n    };\n\n    this.COLORS = [\"#ED5565\", \"#FC6E51\", \"#FFCE54\", \"#A0D468\", \"#48CFAD\", \"#4FC1E9\", \"#5D9CEC\", \"#AC92EC\", \"#EC87C0\", \"#CCD1D9\"];\n\n    this.handleNewQuote = this.handleNewQuote.bind(this);\n    this.getNewQuote = this.getNewQuote.bind(this);\n  }\n\n  componentDidMount() {\n    this.getNewQuote();\n  }\n\n  handleNewQuote() {\n    this.getNewQuote();\n  }\n\n  getNewQuote() {\n    let quote;\n    let funcName = \"handleData\" + new Date().getTime();\n    let interval = null;\n\n    let script = document.createElement(\"script\");\n    script.src = \"https://api.forismatic.com/api/1.0/?method=getQuote&format=jsonp&lang=en&jsonp=\" + funcName;\n    script.id = funcName;\n    // eslint-disable-next-line no-console\n    script.onerror = () => {console.log(\"Something went wrong: script error\");};\n    document.getElementsByTagName(\"head\")[0].appendChild(script);\n\n    // handle slow network/server\n    interval = setTimeout(() => {\n      quote = null;\n      clearInterval(interval);\n      interval = null;\n    }, 400);\n\n    this.setState({visable: false}, () => {\n      setTimeout(() => {\n        let colorIndex = (this.state.colorIndex + 1) % this.COLORS.length;\n        this.setState({\n          quote: quote,\n          visable: true,\n          colorIndex: colorIndex\n        });\n      }, 1000);\n    });\n\n\n    window[funcName] = (e) => {\n      quote = {author: e.quoteAuthor, text: e.quoteText};\n      // if slow network\n      if (!interval) {\n        this.setState({quote: quote});\n      }\n      clearInterval(interval);\n      interval = null;\n  };\n}\n\n  render() {\n    const style = {\n      backgroundColor: this.COLORS[this.state.colorIndex]\n    };\n\n    return (\n      <div className=\"background\" style={style}>\n        <QuoteBox\n          handleNewQuote={this.handleNewQuote}\n          quote={this.state.quote}\n          visable={this.state.visable}\n        />\n      </div>\n    );\n  }\n}\n\nReactDOM.render(<App />, document.getElementById(\"root\"));\n",
